import React from 'react';
import img from '../Images/carsouel2.jpg';

export default function CategoryCard(props) {
  return (
    <div className="col-lg-4 col-md-6 col-sm-12 my-3 text-center">
      <div className="card rounded-circle" style={{ width: '20rem' }}>
        <img src={props.img} className="card-img-top rounded-circle" alt="Recipe Category" />
        <div className="card-body">
            <h4>{}</h4>
        </div>
      </div>
    </div>
  );
}
